import React, {useEffect, useState} from "react";
import Neo from './neo.js';
import './App.css';

function FlightCount () {

  const [neos, setNEOs] = useState([]);

  useEffect(() => {
    //getNEOs();
  }, []);

    const getNEOs = async () => {
    const response = await fetch('https://api.nasa.gov/neo/rest/v1/neo/browse?api_key=WMtTrqwesceUk1odHg4uWnSjNH2FMdWVQdw0h6zG');
    const data = await response.json();
    setNEOs(data.near_earth_objects);
    console.log(data.near_earth_objects);
  }

  return (
    <>
     <button className="flight_count" type="submit">
        <h1> Find current NEO list </h1>
     </button>
     <div>
     {neos.map(neo => (
       <Neo />
     ))}
     </div>
     </>
   );
}

export default FlightCount;
